Culcha Candela is a Dancehall/Reggae/Hip-Hop group from Berlin, Germany, formed in 2002. Their lyrics range from political issues &quot;Una Cosa&quot; to party songs, such as &quot;Partybus&quot;. The name Culcha Candela can be translated into English roughly as &quot;hot&quot; or &quot;bright&quot; culture.Culcha Candela was formed in Berlin by founding members Jonny Strange, Itchyban, and Lafrotino. They were later joined by singers Larsito, Mr. Reedoo, Don Cali, and DJ Chino con Estilo.The differing heritages allows for a mixture of lyrics in German, English, Spanish, and Patois. 


